import React from "react";
import logo from './metro.jpg';
import './App.sass';

function App() {
  return (
    <div className="Metro">
        <div class="absolute top-0 right-0">
        <button class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded-full">
           Login/Signup
          </button>
        </div>
        <div class="absolute width-1512px height-634px left-0px top-96px">
          <img class="object-cover h-100 w-150" img src={logo} alt="Logo" />
        </div>
        <div class="absolute bottom-6">
          me
        </div>
    </div>
  );
}

export default App;
